Linear regression
I’ll start with a simple linear regression, which I expect will be outperformed by a more flexible method.1


lm_spec <- linear_reg() %>%
  set_mode("regression") %>%
  set_engine("lm")

lm_workflow <- workflow() %>%
  add_recipe(ikea_rec) %>%
  add_model(lm_spec)

lm_fit_train <- lm_workflow %>%
  fit(data = ikea_train)



Prediction metrics on the training and testing data:


ikea_train_pred <- augment(lm_fit_train, new_data = ikea_train)
metrics(ikea_train_pred, truth = log_price, estimate = .pred)


