Not as bad as I was expecting, but we can definitely improve on this:
Random forest
Following along with Julia Silge’s approach, I will attempt to tune a random forest model via ranger:


ranger_spec <- rand_forest(mtry = tune(), min_n = tune(), trees = 1000) %>%
  set_mode("regression") %>%
  set_engine("ranger")

ranger_workflow <- workflow() %>%
  add_recipe(ikea_rec) %>%
  add_model(ranger_spec)

# Speed up the tuning with parallel processing
n_cores <- parallel::detectCores(logical = FALSE)
library(doParallel)
cl <- makePSOCKcluster(n_cores - 1)
