We know from part 1 that contactyes (\(\beta_1\)) and tempwarm (\(\beta_2\)) are associated with higher ratings, but we shouldn’t be biasing our priors by using the same data we are modeling. Instead, use a weakly regularizing normal distributions centered at 0:
\[
\begin{align}
\text{logit}(p(y_i \leq j)) &= \theta_j - \beta_1 \text{temp}_i - \beta_2 \text{contact}_i - u( \text{judge}_i) \\
\beta_1 &\sim \text{Normal}(0, 5) \\
\beta_2 &\sim \text{Normal}(0, 5) \\
\theta_j &\sim \text{Normal}(0, 1.5) \\
u(\text{judge}_i) &\sim \text{Normal}(0, \sigma_u) \\
\sigma_u &\sim \text{Half-Cauchy}(0, 2.5)
\end{align}
\]


