  clm(
    rating ~ contact * temp, data = wine, link = "logit"
  )

#drop1(clm_rating_contact_temp_inter, test = "Chisq") # this accomplishes the same thing as anova()
anova(clm_rating_contact_temp, clm_rating_contact_temp_inter)


